import React from "react";
import { Col, Row } from "react-bootstrap";

function AboutUs() {
  return (
    <>
      <Row>
        <Col md={4}>
          <div>
            <img
              src={require("../assets/pic01.jpg")}
              style={{
                borderRadius: "8px",
                maxWidth: "70%",
                height: "auto",
                marginLeft: "-30px",
              }}
              alt="about us"
            />
            <img
              src={require("../assets/pic01.jpg")}
              style={{
                borderRadius: "8px",
                maxWidth: "80%",
                height: "auto",
                marginLeft: "30px",
                marginTop: "-300px",
              }}
              alt="about us"
            />
          </div>
        </Col>
        <Col md={8}>
          <h1>About</h1>
        </Col>
      </Row>
    </>
  );
}

export default AboutUs;
